MGE Guidelines and Limits

The Council has decided to organize the next Mightiest Governor Event (MGE) with specific conditions.
Strict limits are set for stages 1 to 5 in order to prevent unnecessary waste of speedups and resources.
All players are expected to respect these limits.

Stage Limits (Stages 15)

Stage 1  Training
T5 players: Maximum 1.2 million points
T4 players: Maximum 800,000 points

Stage 2  Barbarian Defeating
Unlimited points. However, using Action Points on low-level barbarians is not recommended.

Stage 3  Resource Gathering
Unlimited points. Players may gather freely.

Stage 4  Power Upgrade
Maximum 2 million points for all players.

Stage 5  Kill Event (KE)
Maximum 1 million points for all players.

Stage 6  Final Sprint
Rankings will be closely monitored during the final stage.
Players must strictly respect their assigned ranking positions.

Total Point Limit
Players who are not on the official MGE list must respect a strict total limit of
6,000,000 points across the entire event.

Penalties
Failure to respect the limits will result in the following penalties:
50,000  100,000 points over the limit: 10 million of each resource
101,000  500,000 points over the limit: 20 million of each resource
501,000  999,000 points over the limit: 50 million of each resource
1,000,000+ points over the limit: City will be zeroed and player removed from the kingdom

Please comply with these rules to ensure a fair and efficient event for everyone.

Leadership
